<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Navigation Sidebar</title>
    <style>
        body {
          margin: 0;
          padding: 0;
          font-family: 'Urbanist', sans-serif;
          background-color: #fff;
          display: flex;
      }

      .sidebar {
          width: 60px;
          background-color: #162A84;
          position: fixed;
          top: 0;
          height: 100%;
          display: flex;
          flex-direction: column;
          align-items: center;
          justify-content: space-between;
          margin-left: 0px;
      }

      .shape-container {
          display: flex;
          flex-direction: column;
          align-items: center;
          gap: 0px;
          margin-bottom: -60px;
      }

      .circle {
          background-color: #FCDDEC;
          width: 17px;
          height: 17px;
          border-radius: 50%;
          margin-bottom: 3px;
      }

      .pink-square {
          background-color: #EF5DA8;
          width: 17px;
          height: 17px;
          transform: rotate(26.653deg);
          margin-bottom: 3px;
      }

      .white-rectangle {
          background-color: #fff;
          width: 17px;
          height: 17px;
      }

      .purple-rectangle {
          background-color: #7879F1;
          width: 17px;
          height: 17px;
      }

      .sidebar a {
          display: flex;
          justify-content: center;
          align-items: center;
          width: 24px;
          height: 24px;
          color: white;
          text-decoration: none;
          margin-bottom: 92px;
      }

      .sidebar a:first-child {
          margin-top: 0%;
      }

      .sidebar a:last-child {
          margin-bottom: 98%;
      }

      .sidebar a:hover {
          background-color: #576574;
          border-radius: 50%;
      }

      .sidebar svg {
          width: 84px;
          height: 84px;
      }

      .logo svg {
          width: 24px;
          height: 24px;
      }

      .nav {
          display: flex;
          width: 1.5rem;
          flex-direction: column;
          height: 40%;
          align-content: stretch;
          justify-content: space-around;
      }

      .sidebar a:hover {
          background-color: #576574;
          border-radius: 50%;
      }

      .sidebar a:hover svg path {
          stroke: #FF4081;
      }


      .container {
          margin-left: 80px;
          padding: 20px;
      }


    </style>
</head>
